        auth: {
          username: "bba3469777fb4483a01c60fe868000e9", // API Key
          password: "c1bf8ecbbfe444e0aeaab6aef336aa3b", // API Secret
        },
      })
      .then((response) => {
        // Kiểm tra và xử lý dữ liệu
        // Xử lý dữ liệu 'billing_address' ở đây
